import React from "react";
import { useEffect } from "react";
import { Button } from "./component/Component";
import { useNavigate } from "react-router-dom";

function Dashboard() {
    const navigate = useNavigate();
    useEffect(() => {
        if (localStorage.getItem("isLogin") !== "true") {
            window.location.href = "/";
        }
    }, []);
    const logot = () => {
        localStorage.setItem("isLogin", "false");
        localStorage.removeItem("username");
        navigate("/");
    }
    return(
        <div className="w-full h-screen flex justify-center items-center bg-gray-300">
            <div className="bg-white p-10 rounded-lg shadow-lg">
                <h1 className="text-2xl font-bold mb-4">Dashboard</h1>
                <p className="mb-4">Welcome, {localStorage.getItem("username")}</p>
                <Button onClick={logot} className="bg-red-500 text-white hover:bg-red-700">
                    Logout
                </Button>
            </div>
        </div>
    )
}
export default Dashboard;
